const url = "https://frebi.willandskill.eu/"
const auth = "api-token-auth/"

export default class UserKit {
    
    static login(payload){
    
        return fetch(url +  auth,{
            method: "POST", 
            body: JSON.stringify(payload),
            headers: {
                "Content-type": "application/json"
              }
        })
    
    }
    static login(payload){
    
        return fetch(url +  auth,{
            method: "POST", 
